import React, { useState } from "react";
import axios from "axios";

const NodeDataVisualizer = () => {
  const [node1Data, setNode1Data] = useState([]);
  const [node2Data, setNode2Data] = useState([]);
  const [error, setError] = useState("");

  const fetchNodeData = async (nodeId, setNodeData) => {
    setError("");
    try {
      const response = await axios.get(`https://smart-farm-v14p.onrender.com/get_node_data/${nodeId}`);
      if (response.status === 200 && response.data.status === "success") {
        setNodeData(response.data.data);
      } else {
        setError(`Failed to fetch data for Node ${nodeId}`);
      }
    } catch (err) {
      setError(`Error fetching data for Node ${nodeId}: ${err.message}`);
    }
  };

  const handleFetchData = async () => {
    await fetchNodeData(1, setNode1Data);
    await fetchNodeData(2, setNode2Data);
  };

  return (
    <div className="node-visualizer">
      <h2>LoRa Node Data Visualization</h2>
      <button onClick={handleFetchData}>Fetch Data for All Nodes</button>

      {error && <p className="error">{error}</p>}

      {/* Node 1 Table */}
      {node1Data.length > 0 && (
        <div className="table-container">
          <h3>Node 1 Data</h3>
          <table>
            <thead>
              <tr>
                <th>Timestamp</th>
                <th>Moisture</th>
                <th>Humidity</th>
                <th>Temperature</th>
                <th>Pump Status</th>
              </tr>
            </thead>
            <tbody>
              {node1Data.map((entry, index) => (
                <tr key={index}>
                  <td>{entry.timestamp}</td>
                  <td>{entry.moisture}</td>
                  <td>{entry.humidity}</td>
                  <td>{entry.temperature}</td>
                  <td>{entry.pump_status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {/* Node 2 Table */}
      {node2Data.length > 0 && (
        <div className="table-container">
          <h3>Node 2 Data</h3>
          <table>
            <thead>
              <tr>
                <th>Timestamp</th>
                <th>Moisture</th>
                <th>Humidity</th>
                <th>Temperature</th>
                <th>Pump Status</th>
              </tr>
            </thead>
            <tbody>
              {node2Data.map((entry, index) => (
                <tr key={index}>
                  <td>{entry.timestamp}</td>
                  <td>{entry.moisture}</td>
                  <td>{entry.humidity}</td>
                  <td>{entry.temperature}</td>
                  <td>{entry.pump_status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default NodeDataVisualizer;
